import React from 'react';
import avatar from './DonkeyKong.png';
import ModeToggler from './ModeToggler';

function Logo(props){
  const userPic = <img src={avatar}/>;
  return userPic;
}


function App() {
  return (
    <div>
      <Logo />
      <ModeToggler />
      <h1>Task: Add three Card elements</h1>
    </div>
  );
}

export default App;
